pragma solidity ^0.8.0;
pragma experimental ABIEncoderV2;

contract Type3 {
    struct Point {
        uint256 x;
        uint256 y;
    }

    struct Part1 {
        Point cy;
        Point cR1;
        Point cR2;
        uint256 r1_hat;
        uint256 r2_hat;
        uint256 l0_value;
        uint256 yP;
        uint256 yU;
        uint256[] dv_value;
        uint256[] bv_value;
        uint256[] luxs;
        uint256[] pi_px;
        uint256[] pi_ux;
        Point[] cDs;
        Point[] cWs;
        Point[] cmp;
        Point[] cmu;
    }


    uint256 public constant GX = 1;
    uint256 public constant HX = 9727523064272218541460723335320998459488975639302513747055235660443850046724;
    uint256 public constant GY = 2;
    uint256 public constant HY = 5031696974169251245229961296941447383441169981934237515842977230762345915487;

    uint256 public constant PP = 0x30644e72e131a029b85045b68181585d97816a916871ca8d3c208c16d87cfd47;
    uint256 internal constant NN = 0x30644e72e131a029b85045b68181585d2833e84879b9709143e1f593f0000001;

    uint256 private constant G1X = 10634783317254738331264664985092831821376621286957316213969233667217643505748;
    uint256 private constant G1Y = 3593894136463563836927847830567934263138852783181300960240960063050894828762;
    uint256 private constant G2X = 15079475582167754912076991092891442787377018931665830331839902737242049589194;
    uint256 private constant G2Y = 2994786716555744767228318303490139874612995833883024157075109374536749910797;
    uint256 private constant G3X = 5998026607105146355656696147154635391947958755485950806629481563238770197831;
    uint256 private constant G3Y = 9071495078062910622295597859043028737780972268539387614597098676522874141228;
    uint256 private constant G4X = 16523801944179829840198169326704340952379740918805059924608153703458536682146;
    uint256 private constant G4Y = 6038302089791721424956127465108246322480323157317821739578233683122154868638;
    uint256 private constant G5X = 12118397309736405059200255390820856272335184322136103314456373515523090868384;
    uint256 private constant G5Y = 3299068400210186031537495205944296158829957843773210327992629444571521214447;
    uint256 private constant G6X = 13569683714700597868720693802606454625784876902328159148425602640793284360016;
    uint256 private constant G6Y = 6196366122510722436252226379612342063576138922717891371699758504638443909810;
    uint256 private constant G7X = 6931749079582407422004463406148477362357661472338328270508373724106071518625;
    uint256 private constant G7Y = 21191302843410952823242789471696212271196775028224076743387772065534892367978;

    function mod(uint256 a, uint256 b)
        public
        pure
        returns (uint256)
    {
        require(b != 0, "SafeMath: modulo by zero");

        uint256 c;
        assembly {
            c := mod(a, b)
        }

        return c;
    }

    function verifyRangeArgument(Part1 memory part1, uint256 K, uint256 B)
        external
        returns (uint256)
    {
        // (uint256[] memory betas, uint256 x) = computeChallenges(part1, K);

        // checkPolyVerify(part1.cmp, part1.pi_px, x, K);
        // checkPolyVerify(part1.cmu, part1.pi_ux, x, K);

        // checkCond1(part1, K);

        // checkCond2(betas, part1, K, B);

        // checkCond3(part1);

        // checkCond4(part1.cy, part1.cWs);

        // assert (ret_add_input_total[0] == Fx && ret_add_input_total[1] == Fy);

    }

    function checkPolyVerify(Point[] memory cmp, uint256[] memory pi_px, uint256 x, uint K)
        internal
    {
        uint256[3] memory mul_input;
        uint256[4] memory add_input;
        bool success;

        uint256 size = K;
        Point[] memory gs = generateGS(size);
        // Point memory p = cmp[0];
        // mul_input[0] = p.x;
        // mul_input[1] = p.y;
        // mul_input[2] = 1;
        // assembly {
        //     success := call(not(0), 7, 0, mul_input, 0x80, add(add_input, 0x0), 0x60)
        // }

        // for(uint i=1;i<size;i++){
        //     Point memory p = cmp[i];
        //     mul_input[0] = p.x;
        //     mul_input[1] = p.y;
        //     // mul_input[2] = mod(x ** i, NN);
        //     mul_input[2] = x;

        //     assembly {
        //         success := call(not(0), 7, 0, mul_input, 0x80, add(add_input, 0x40), 0x60)
        //     }

        //     assembly {
        //         success := call(not(0), 6, 0, add_input, 0x80, add_input, 0x60)
        //     }
        // }


        // uint256 eqn2_1 = pi_px[0];

        // for(uint256 i = 1; i < K; i++){
        //     uint256 exp = (i-1)*K + K - K*K;
        //     // uint256 pix = addmod(pi_px[i], mod(x ** exp, NN), NN);
        //     uint256 pix = addmod(pi_px[i], x, NN);
        //     eqn2_1 = addmod(eqn2_1, pix, NN);
        // }


        for(uint i=0;i<size;i++) {
            Point memory g = gs[i];
            mul_input[0] = g.x;
            mul_input[1] = g.y;
            mul_input[2] = pi_px[i];

            assembly {
                success := call(not(0), 7, 0, mul_input, 0x80, add(add_input, 0x40), 0x60)
            }

            assembly {
                success := call(not(0), 6, 0, add_input, 0x80, add_input, 0x60)
            }
        }



    }

    function computeChallenges(Part1 memory part1, uint K)
        internal
        pure
        returns (uint256[] memory x, uint256 y)
    {

        (uint256 x, uint256 challenge) = computeBaseChallenge(part1.cDs, part1.cWs, part1.cR1, part1.cR2, part1.cmp);

        uint256[] memory challenges = new uint256[](K+1);

        uint256 challenge2 = mulmod(challenge, challenge, NN);
        uint256 challenge3 = mulmod(challenge2, challenge, NN);
        uint256 challenge4 = mulmod(challenge2, challenge2, NN);
 

        challenges[0] = 1;
        challenges[1] = challenge;
        challenges[2] = challenge2;
        challenges[3] = challenge3;
        challenges[4] = challenge4;

        if (K == 5){
            uint256 challenge5 = mulmod(challenge2, challenge3, NN);
            challenges[5] = challenge5;
        }
        if (K == 7){
            uint256 challenge5 = mulmod(challenge2, challenge3, NN);
            uint256 challenge6 = mulmod(challenge3, challenge3, NN);
            uint256 challenge7 = mulmod(challenge3, challenge4, NN);
            challenges[5] = challenge5;
            challenges[6] = challenge6;
            challenges[7] = challenge7;
        }

        return (challenges, x);
    }

    function checkCond1(Part1 memory part1, uint256 K)
        internal
    {
        (uint256 dvpx, uint256 dvpy) = computeDVPoint(part1.dv_value);

        uint256[3] memory mul_input;
        uint256[4] memory add_input;
        bool success;

        mul_input[0] = HX;
        mul_input[1] = HY;
        mul_input[2] = part1.r1_hat;
        assembly {
            success := call(not(0), 7, 0, mul_input, 0x80, add(add_input, 0x40), 0x60)
        }

        add_input[0] = dvpx;
        add_input[1] = dvpy;
        assembly {
            success := call(not(0), 6, 0, add_input, 0x80, add_input, 0x60)
        }

        uint256 ret1x = add_input[0];
        uint256 ret1y = add_input[1];

        (add_input[0], add_input[1]) = computeCDWS(part1.cDs, part1.cR1, part1.l0_value, part1.luxs);

        // assert (add_input[0] == ret1x && add_input[1] == ret1y);
    }

    function checkCond2(uint256[] memory challenges, Part1 memory part1, uint256 K, uint256 B)
        internal
    {
        uint256 betadv = 1;
        for(uint j = 0; j < uint(K); j++){
            for(uint i = 0; i < uint(B); i++){
                uint256 dvi = part1.dv_value[i];
                betadv = mulmod(betadv, dvi - uint256(i), NN);
            }
        }

        uint256 eqn2_1 = betadv;

        uint256 eqn2_2 = mulmod(part1.yP, part1.l0_value, NN);


        // assert (eqn2_1 == eqn2_2);

    }

    function computeCDWS(Point[] memory cs, Point memory cR, uint256 l0_value, uint256[] memory luxs)
        internal
        returns (uint256 x, uint256 y)
    {
       uint size = cs.length;

        uint256[3] memory mul_input;
        uint256[4] memory add_input;
        bool success;

        Point memory p = cs[0];
        mul_input[0] = p.x;
        mul_input[1] = p.y;
        mul_input[2] = luxs[0];
        assembly {
            success := call(not(0), 7, 0, mul_input, 0x80, add(add_input, 0x0), 0x60)
        }

        for(uint i=1;i<size;i++){
            Point memory p = cs[i];
            mul_input[0] = p.x;
            mul_input[1] = p.y;
            mul_input[2] = luxs[i];

            assembly {
                success := call(not(0), 7, 0, mul_input, 0x80, add(add_input, 0x40), 0x60)
            }

            assembly {
                success := call(not(0), 6, 0, add_input, 0x80, add_input, 0x60)
            }
        }


        mul_input[0] = cR.x;
        mul_input[1] = cR.y;
        mul_input[2] = l0_value;
        assembly {
            success := call(not(0), 7, 0, mul_input, 0x80, add(add_input, 0x40), 0x60)
        }

        assembly {
            success := call(not(0), 6, 0, add_input, 0x80, add_input, 0x60)
        }


        return (add_input[0], add_input[1]);
    }



    function checkCond3(Part1 memory part1)
        internal
    {
        uint256[3] memory mul_input;
        uint256[4] memory add_input;
        bool success;

        

        mul_input[0] = GX;
        mul_input[1] = GY;
        // mul_input[2] = uint(part1.Bkeu);
        mul_input[2] = computeGexp(part1.dv_value, part1.l0_value, part1.yU, part1.bv_value);
        assembly {
            success := call(not(0), 7, 0, mul_input, 0x80, add_input, 0x60)
        }
        
        mul_input[0] = HX;
        mul_input[1] = HY;
        mul_input[2] = part1.r2_hat;

        assembly {
            success := call(not(0), 7, 0, mul_input, 0x80, add(add_input, 0x40), 0x60)
        }

        assembly {
            success := call(not(0), 6, 0, add_input, 0x80, add_input, 0x60)
        }

        uint256 ret3x = add_input[0];
        uint256 ret3y = add_input[1];

        (add_input[0], add_input[1]) = computeCDWS(part1.cWs, part1.cR2, part1.l0_value, part1.luxs);

        // assert (add_input[0] == ret3x && add_input[1] == ret3y);


    }

    function computeGexp(uint256[] memory dv_value, uint256 l0_value, uint256 yU, uint256[] memory bv_value)
        internal
        pure
        returns (uint256 x)
    {
        uint256 G1_exp = mulmod(yU, l0_value, NN);
        uint256 dvsize = dv_value.length;
        for (uint i = 0; i < dvsize; i++){
            uint256 dvbv = mulmod(dv_value[i], bv_value[i], NN);
            G1_exp = addmod(G1_exp, dvbv, NN);
        }

        return G1_exp;
    }


    function checkCond4(Point memory cy, Point[] memory cws)
        internal
    {
        uint wsize = cws.length - 1;
        uint256[4] memory add_input;
        bool success;

        Point memory p = cws[0];
        add_input[0] = p.x;
        add_input[1] = p.y;
        for(uint i=1;i<wsize;i++) {
            Point memory p = cws[i];
            add_input[2] = p.x;
            add_input[3] = p.y;
            assembly {
                success := call(not(0), 6, 0, add_input, 0x80, add_input, 0x60)
            }
        }

        // assert (cy.x == add_input[0] && cy.y == add_input[1]);
    }

    function computeBaseChallenge(Point[] memory cDs, Point[] memory cWs, Point memory cR1, Point memory cR2, Point[] memory cmp)
        internal
        pure
        returns (uint256 x, uint256 y)
    {
        uint cwslength = cDs.length;
        uint cmslength = cWs.length;
        uint cmplength = cmp.length;

        uint256 size = 2 * (cwslength + cmslength + cmplength + 2);
        uint256[] memory cs = new uint256[](size);
        uint offset = 0;
        for(uint i=0;i<cwslength;i++) {
            Point memory p = cDs[i];
            cs[offset] = p.x;
            offset = offset + 1;
            cs[offset] = p.y;
            offset = offset + 1;
        }
        for(uint i=0;i<cmslength;i++) {
            Point memory p = cWs[i];
            cs[offset] = p.x;
            offset = offset + 1;
            cs[offset] = p.y;
            offset = offset + 1;
        }
        cs[offset] = cR1.x;
        offset = offset + 1;
        cs[offset] = cR1.y;
        offset = offset + 1;

        cs[offset] = cR2.x;
        offset = offset + 1;
        cs[offset] = cR2.y;
        offset = offset + 1;

        uint256 baseChal = mod(uint256(keccak256(abi.encodePacked(cs))), NN);

        for(uint i=0;i<cmslength;i++) {
            Point memory p = cmp[i];
            cs[offset] = p.x;
            offset = offset + 1;
            cs[offset] = p.y;
            offset = offset + 1;
        }
        uint256 x = mod(uint256(keccak256(abi.encodePacked(cs))), NN);

        return (x, baseChal);
    }

    function computeDVPoint(uint256[] memory dv_value)
        internal
        returns (uint256 x, uint256 y)
    {
        uint256[3] memory mul_input;
        uint256[4] memory add_input;
        bool success;

        add_input[0] = 0;
        add_input[1] = 0;

        uint size = dv_value.length;

        Point[] memory gs = generateGS(size);
        for(uint i=0;i<size;i++) {
            Point memory g = gs[i];
            mul_input[0] = g.x;
            mul_input[1] = g.y;
            mul_input[2] = dv_value[i];

            assembly {
                success := call(not(0), 7, 0, mul_input, 0x80, add(add_input, 0x40), 0x60)
            }

            assembly {
                success := call(not(0), 6, 0, add_input, 0x80, add_input, 0x60)
            }
        }

        return (add_input[0], add_input[1]);
    }

    function generateGS(uint L)
        internal
        pure
        returns (Point[] memory)
    {
        Point[] memory gs = new Point[](L);
        gs[0] = Point(G1X, G1Y);
        gs[1] = Point(G2X, G2Y);
        gs[2] = Point(G3X, G3Y);
        gs[3] = Point(G4X, G4Y);
        if (L == 5){
            gs[4] = Point(G5X, G5Y);
        }
        if (L == 7){
            gs[4] = Point(G5X, G5Y);
            gs[5] = Point(G6X, G6Y);
            gs[6] = Point(G7X, G7Y);

        }

        return gs;
    }

}
